import React, { useContext, useEffect } from 'react';

import { MedicinesContext, MedicinaContextType, MedicinaContext } from '../App';

const MedicineList = () => {
    //const { medicinas, setMedicinasList} = useContext(MedicinesContext) as MedicinaContextType;
    const { medicinaData } = React.useContext(MedicinaContext);
    const info =  medicinaData;
    console.log("medicinaData", medicinaData);
    return (
        <section className='first-section-wrapper'>
            <h2>Lista de medicamentos</h2>
            {medicinaData && <p>{medicinaData.pills[0].brand}</p>}



            <h3>Pastillas</h3>
            <table>
                <thead>
                    <tr>
                        <th>
                            Marca que ofrecemos
                        </th>
                        <th>
                            Laboratorio
                        </th>
                        <th>
                            Precio(sin cobertura m√©dica)
                        </th>
                    </tr>  
                </thead>
                 <tbody>
                    {medicinaData &&  (
                      medicinaData.pills.map((pill: { brand: string; laboratory: string; price: number }) => (
                        <tr>
                            <td>{pill.brand}</td>
                            <td>{pill.laboratory}</td>
                            <td>{pill.price}</td>
                        </tr>
                      )
                      )  
                    )}
                 </tbody>                
            </table>
            <h3>Anillos</h3>
                <tbody>
                    {medicinaData &&  (
                      medicinaData.rings.map((ring: { brand: string; laboratory: string; price: number }) => (
                        <tr>
                            <td>{ring.brand}</td>
                            <td>{ring.laboratory}</td>
                            <td>{ring.price}</td>
                        </tr>
                      )
                      )  
                    )}
                 </tbody>
            <h3>Parches</h3>
        </section>
    );
}

export default MedicineList;
